import React from 'react';
import './App.css';


function App() {
  return (
      <div className='app-wrapper'>
         <header>
             <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/1/1c/DC_Comics_logo.png/600px-DC_Comics_logo.png" />
         </header>
          <nav>
              <div>Profile</div>
              <div>Messages</div>
          </nav>
          <div>Main content</div>
      </div>
  );
}

export default App;
